def affine(weight, bias, vector):
    assert len(weight) == len(bias), \
        'shape must match: %d != %d' % (len(weight), len(bias))
    assert len(weight[0]) == len(vector), \
        'shape must match: %d != %d' % (len(weight[0]), len(vector))
    result = [0 for _ in range(len(bias))]
    for idx, row in enumerate(weight):
        temp = 0
        for v, w in zip(vector, row):
            temp += v * w
        result[idx] = temp + bias[idx]
    return result

def relu(vector):
    return [max(0, e) for e in vector]

def preprocess(x):
    x = int(x) / 255.0
    x = (x - 0.1307) / 0.3081
    return x

def infer(image):
    x = []
    for row in image:
        x.extend(row)
    x = affine(fc1_weight, fc1_bias, x)
    x = relu(x)
    x = affine(fc2_weight, fc2_bias, x)
    return x.index(max(x))

T = int(input())
for _ in range(T):
    t = [input() for _ in range(28)]
    for i in range(28):
        t[i] = list(map(preprocess, t[i].split()))
